import React, { useState } from 'react';
import {
    TextField,
    Button,
    Grid,
    Paper,
    Typography,
    FormControl,
    InputLabel,
    Select,
    MenuItem,
    Snackbar,
} from '@mui/material';
import Alert from '@mui/material/Alert';

const FATCAUpload = () => {
    const initialFormState = {
        pan_rp: '',
        inv_name: '',
        dob: '',
        tax_status: '04',
        data_src: 'P',
        addr_type: '3',
        po_bir_inc: '',
        co_bir_inc: 'IN',
        tax_res1: 'IN',
        tpin1: '',
        id1_type: 'C',
        srce_wealt: '02',
        corp_servs: '01',
        inc_slab: '32',
        net_worth: '',
        nw_date: '',
        pep_flag: 'N',
        occ_code: '01',
        occ_type: 'B',
        exemp_code: 'M',
        ffi_drnfe: 'FFI',
        giin_no: '',
        spr_entity: '',
        giin_na: 'NO',
        giin_exemc: '1',
        nffe_catg: 'A',
        act_nfe_sc: '07',
        nature_bus: '',
        ubo_appl: 'Y',
        sdf_flag: 'Y',
        ubo_df: 'Y',
        ubo_details: [{
            ubo_name: '',
            ubo_pan: '',
            ubo_nation: 'IN',
            ubo_add1: '',
            ubo_add2: '',
            ubo_add3: '',
            ubo_city: '',
            ubo_pin: '',
            ubo_state: '',
            ubo_cntry: 'IN',
            ubo_add_ty: '2',
            ubo_ctr: 'IN',
            ubo_tin: '',
            ubo_id_ty: 'C',
            ubo_cob: 'IN',
            ubo_dob: '',
            ubo_gender: 'M',
            ubo_fr_nam: '',
            ubo_occ: '01',
            ubo_occ_ty: 'B',
            ubo_tel: '',
            ubo_mobile: '',
            ubo_code: 'C01',
            ubo_hol_pc: '',
            ubo_email: ''
        }]
    };

    const [formData, setFormData] = useState(initialFormState);
    const [snackbar, setSnackbar] = useState({
        open: false,
        message: '',
        severity: 'info'
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData(prev => ({
            ...prev,
            [name]: value
        }));
    };

    const handleUBOChange = (index, field, value) => {
        const newUBODetails = [...formData.ubo_details];
        newUBODetails[index] = {
            ...newUBODetails[index],
            [field]: value
        };
        setFormData(prev => ({
            ...prev,
            ubo_details: newUBODetails
        }));
    };

    const formatDateToNSE = (dateStr) => {
        if (!dateStr) return '';
        const date = new Date(dateStr);
        return date.toLocaleDateString('en-GB', {
            day: '2-digit',
            month: '2-digit',
            year: 'numeric'
        }).split('/').join('/');
    };

    const validateForm = () => {
        const requiredFields = [
            'pan_rp',
            'inv_name',
            'dob',
            'po_bir_inc',
            'net_worth',
            'nw_date'
        ];

        const missingFields = requiredFields.filter(field => !formData[field]);

        if (missingFields.length > 0) {
            setSnackbar({
                open: true,
                message: `Please fill in all required fields: ${missingFields.join(', ')}`,
                severity: 'error'
            });
            return false;
        }

        if (formData.ubo_appl === 'Y' && (!formData.ubo_details || !formData.ubo_details[0])) {
            setSnackbar({
                open: true,
                message: 'UBO details are required',
                severity: 'error'
            });
            return false;
        }

        return true;
    };

    const handleSubmit = async (e) => {
        e.preventDefault();

        if (!validateForm()) {
            return;
        }

        try {
            // Format dates before sending
            const formattedData = {
                ...formData,
                dob: formatDateToNSE(formData.dob),
                nw_date: formatDateToNSE(formData.nw_date),
                ubo_details: formData.ubo_details.map(ubo => ({
                    ...ubo,
                    ubo_dob: formatDateToNSE(ubo.ubo_dob)
                }))
            };

            const response = await fetch('/api/fatca-upload', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify({
                    reg_details: [formattedData]
                }),
            });

            const data = await response.json();
            console.log('FATCA Response:', data);

            setSnackbar({
                open: true,
                message: data.message || 'FATCA registration processed',
                severity: data.success ? 'success' : 'error'
            });

            if (data.success) {
                setFormData(initialFormState);
            }
        } catch (error) {
            console.error('FATCA Registration Error:', error);
            setSnackbar({
                open: true,
                message: error.message || 'Error submitting FATCA registration',
                severity: 'error'
            });
        }
    };

    const handleCloseSnackbar = () => {
        setSnackbar(prev => ({ ...prev, open: false }));
    };

    return (
        <Paper style={{ padding: 20, margin: 20 }}>
            <Typography variant="h6" gutterBottom>
                FATCA Registration
            </Typography>
            <form onSubmit={handleSubmit}>
                <Grid container spacing={3}>
                    <Grid item xs={12} sm={6}>
                        <TextField
                            required
                            fullWidth
                            label="PAN"
                            name="pan_rp"
                            value={formData.pan_rp}
                            onChange={handleChange}
                        />
                    </Grid>
                    <Grid item xs={12} sm={6}>
                        <TextField
                            required
                            fullWidth
                            label="Investor Name"
                            name="inv_name"
                            value={formData.inv_name}
                            onChange={handleChange}
                        />
                    </Grid>
                    <Grid item xs={12} sm={6}>
                        <TextField
                            required
                            fullWidth
                            label="Date of Birth/Incorporation"
                            name="dob"
                            type="date"
                            value={formData.dob}
                            onChange={handleChange}
                            InputLabelProps={{
                                shrink: true,
                            }}
                        />
                    </Grid>
                    <Grid item xs={12} sm={6}>
                        <FormControl fullWidth>
                            <InputLabel>Tax Status</InputLabel>
                            <Select
                                name="tax_status"
                                value={formData.tax_status}
                                onChange={handleChange}
                            >
                                <MenuItem value="04">Non Individual</MenuItem>
                            </Select>
                        </FormControl>
                    </Grid>
                    <Grid item xs={12} sm={6}>
                        <TextField
                            required
                            fullWidth
                            label="Place of Birth/Incorporation"
                            name="po_bir_inc"
                            value={formData.po_bir_inc}
                            onChange={handleChange}
                        />
                    </Grid>
                    <Grid item xs={12} sm={6}>
                        <TextField
                            required
                            fullWidth
                            label="Nature of Business"
                            name="nature_bus"
                            value={formData.nature_bus}
                            onChange={handleChange}
                        />
                    </Grid>
                    <Grid item xs={12} sm={6}>
                        <TextField
                            required
                            fullWidth
                            label="Net Worth"
                            name="net_worth"
                            type="number"
                            value={formData.net_worth}
                            onChange={handleChange}
                        />
                    </Grid>
                    <Grid item xs={12} sm={6}>
                        <TextField
                            required
                            fullWidth
                            label="Net Worth Date"
                            name="nw_date"
                            type="date"
                            value={formData.nw_date}
                            onChange={handleChange}
                            InputLabelProps={{
                                shrink: true,
                            }}
                        />
                    </Grid>

                    {/* UBO Details Section */}
                    <Grid item xs={12}>
                        <Typography variant="h6" gutterBottom>
                            UBO Details
                        </Typography>
                    </Grid>

                    {formData.ubo_details.map((ubo, index) => (
                        <React.Fragment key={index}>
                            <Grid item xs={12} sm={6}>
                                <TextField
                                    required
                                    fullWidth
                                    label="UBO Name"
                                    value={ubo.ubo_name}
                                    onChange={(e) => handleUBOChange(index, 'ubo_name', e.target.value)}
                                />
                            </Grid>
                            <Grid item xs={12} sm={6}>
                                <TextField
                                    required
                                    fullWidth
                                    label="UBO PAN"
                                    value={ubo.ubo_pan}
                                    onChange={(e) => handleUBOChange(index, 'ubo_pan', e.target.value)}
                                />
                            </Grid>
                            <Grid item xs={12} sm={6}>
                                <TextField
                                    required
                                    fullWidth
                                    label="UBO Address Line 1"
                                    value={ubo.ubo_add1}
                                    onChange={(e) => handleUBOChange(index, 'ubo_add1', e.target.value)}
                                />
                            </Grid>
                            <Grid item xs={12} sm={6}>
                                <TextField
                                    required
                                    fullWidth
                                    label="UBO Mobile"
                                    value={ubo.ubo_mobile}
                                    onChange={(e) => handleUBOChange(index, 'ubo_mobile', e.target.value)}
                                />
                            </Grid>
                            <Grid item xs={12} sm={6}>
                                <TextField
                                    required
                                    fullWidth
                                    label="UBO Email"
                                    type="email"
                                    value={ubo.ubo_email}
                                    onChange={(e) => handleUBOChange(index, 'ubo_email', e.target.value)}
                                />
                            </Grid>
                            <Grid item xs={12} sm={6}>
                                <TextField
                                    required
                                    fullWidth
                                    label="Holding Percentage"
                                    type="number"
                                    value={ubo.ubo_hol_pc}
                                    onChange={(e) => handleUBOChange(index, 'ubo_hol_pc', e.target.value)}
                                />
                            </Grid>
                        </React.Fragment>
                    ))}

                    <Grid item xs={12}>
                        <Button
                            type="submit"
                            variant="contained"
                            color="primary"
                            style={{ marginTop: 20 }}
                        >
                            Submit FATCA Registration
                        </Button>
                    </Grid>
                </Grid>
            </form>

            <Snackbar
                open={snackbar.open}
                autoHideDuration={6000}
                onClose={handleCloseSnackbar}
            >
                <Alert
                    onClose={handleCloseSnackbar}
                    severity={snackbar.severity}
                >
                    {snackbar.message}
                </Alert>
            </Snackbar>
        </Paper>
    );
};

export default FATCAUpload;
